import { DynamicQueryPart, WithId } from "../state";

export interface SampleData {
    sampleDataId: number;
    sampleDataDescr: string;
    sampleDataLocation: string;
    count: number;
}

export const initialSampleDataState: SampleData[] & WithId = Object.assign([], {_id: ''});

export const initialSampleDataFiltersState: DynamicQueryPart & WithId = {_id: ''};
